Real Wife Stories - Candy Manson - The Postman Always Cums Twice

November 22nd, 2010 

Candy is a frustrated housewife who's been ordering packages left, right and center. The reason for this is because each and every day, Postman Danny delivers them to her front door. Candy really wants to jump his bones but doesn't want to betray her husband. One day, however, she decides to throw caution to the wind and spreads wide open in anticipation for a &quot;special delivery.&quot;
